  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:18.319871\",\n\t\"name\": \"alaska-yukon-waterfowl-breeding-pair-survey-may-20-to-june-14-1968\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the waterfowl breeding
  pair survey results for the Alaska and Yukon territory during the 1968 breeding
  season. Population indexes were up for all species of ducks except goldeneye, bufflehead
  and eider, species for which the sample is inadequate. The total index was up 73%
  from last year and up 35% from the ten year average and is the highest index in
  thirteen years of comparable surveys. Good production in 1967 would account for
  part of the increase but the indications are that there has been an influx of ducks
  from other areas as well.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
